import React from 'react';
import { Typography, Layout } from 'antd';

const { Text, Paragraph, Title } = Typography;
const { Content } = Layout;

export const Policy = () => {
  return (
    <Content>
      <Title>Privacy Policy</Title>
      <Text>03/14/2020</Text>
      <Paragraph>Will live here.</Paragraph>
    </Content>
  )
}
